import React from 'react';
import logo from './image/logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          The site is under maintainance
        </p>

      </header>
    </div>
  );
}

export default App;
